import React from 'react';

function BoardList({ posts, onDelete, onSelect }) {
  return (
    <ul>
      {posts.map(post => (
        <li key={post.id}>
          <span
            style={{ cursor: 'pointer', textDecoration: 'underline' }}
            onClick={() => onSelect(post)}
          >
            {post.title}
          </span>
          <button onClick={() => onDelete(post.id)}>삭제</button>
        </li>
      ))}
    </ul>
  );
}

export default BoardList;
